  const data = useContext(WeeklyInfoContext);
  return (
    <div>
      <p>exercise</p>
      <p>{data.momInfo.exerciseInfo.briefInfo}</p>
      <p>{data.momInfo.exerciseInfo.detailedInfo}</p>
    </div>
  );
}

export default Exercise;
